import React from 'react';
import '../styles.css';

const Footer = () => {
  return (
    <footer>
      <p>&copy; 2024 Rainbow Vista Art Inc. All rights reserved.</p>
      
      <p>Email: rainbowvistaart@gmail.com</p>
      <p>Sejal Patel: 416-856-9326</p>
      <p>Charul Desai: 905-586-5818</p>
    </footer>
  );
}

export default Footer;
